        background : black;
        color   :   white;
        padding :   12px 64px;
        display :   flex;
        flex-direction  :   row;
        justify-content :   space-between;
    `;

    const HeaderSubContainer = styled.div`
        color   :   white;
        padding :   8px;
        display :   flex;
        flex-direction  :   row;
        font-weight : 600;
        align-items :   center;
        gap     :   20px;
    `;

    const SearchBar = styled.div`
        background  : #2d2d2d;
        padding     : 12px;
        width       : 100%;
        border      : solid 1px grey;
        border-radius   : 8px;
    `;

    const PrimaryGlowingButton = styled.div`
        background  :   #1b1b1b;
        color       :   #DDDDDD;
        border-radius : 128px;
        padding     : 16px 32px;
        border      :   1px solid #303030;

    `;

    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryGlowingButton><svg
      viewBox="0 0 1024 1024"
      fill="currentColor"
      height="24px"
      width="24px"><path d="M909.6 854.5L649.9 594.8C690.2 542.7 712 479 712 412c0-80.2-31.3-155.4-87.9-212.1-56.6-56.7-132-87.9-212.1-87.9s-155.5 31.3-212.1 87.9C143.2 256.5 112 331.8 112 412c0 80.1 31.3 155.5 87.9 212.1C256.5 680.8 331.8 712 412 712c67 0 130.6-21.8 182.7-62l259.7 259.6a8.2 8.2 0 0011.6 0l43.6-43.5a8.2 8.2 0 000-11.6zM570.4 570.4C528 612.7 471.8 636 412 636s-116-23.3-158.4-65.6C211.3 528 188 471.8 188 412s23.3-116.1 65.6-158.4C296 211.3 352.2 188 412 188s116.1 23.2 158.4 65.6S636 352.2 636 412s-23.3 116.1-65.6 158.4z" />
    </svg></PrimaryGlowingButton>
            <PrimaryGlowingButton>Account</PrimaryGlowingButton>
            <PrimaryGlowingButton>Notifications</PrimaryGlowingButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
